import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Home() {
  const [post, setPost] = useState([])
  const url = "http://localhost:3000/posts";
  console.log(post);

  useEffect(() => {
    axios.get(url).then((res) => {
    setPost(res.data);
    });
  }, []);

  return (
    <div>
       <div className='post-div' >
         {
          post.map((post) => (
          <div key={post.id}>
            <h2>{post.title}</h2>
            <p>{post.content}</p>
          </div>
        ))
         }
       </div> 
    </div>
  )
}

export default Home
